module.exports = JSON.parse('{"title":"Make a Blog using NextJS","date":"2023-06-21T00:00:00.000Z","description":"Hello World","tags":["settings"],"body":{"raw":"\\r\\n\\r\\n## 기본설정\\r\\n\\r\\n### Type Script\\r\\n\\r\\n1. ```tsconfig.json```\\r\\n\\r\\n\\r\\n2. ```global.d.ts```\\r\\n  + scss 인식을 못하면 ```declare module \'*.scss\';``` 를 추가해보자.\\r\\n\\r\\n\\r\\n### 주의사항\\r\\n\\r\\nApp Router 와 Page Router 에서 지원되는 기능도 다르고 공식 문서도 분리되어 있다. 예를들어 ```getStaticProps()```  같은 Data Fetch 작업은 Page Router 에서는 작동하지 않는다. \\r\\n\\r\\nstyle module 에서 클래스 이름에 ```-``` 가 들어간다면 ```MyModule[\\"aaa-bbb\\"]``` 이렇게 직접 써야한다. gatsby 처럼 자동으로 ```MyModule.aaaBBB``` 로 만들어 주지 않는다.\\r\\n\\r\\n### Style\\r\\n\\r\\nexternal css 가 scss 에서 ```@import``` 하면 적용이 안된다. ```<Link>``` 를 쓰던가 css 로 하면 된다. ```@import``` 가 순서대로 하나씩 로딩하는거라 시간이 걸린다고 하지만 유지관리 하기가 불편해서 그냥 css 로 했다.\\r\\n","html":"<h2 id=\\"기본설정\\">기본설정</h2>\\n<h3 id=\\"Type-Script\\">Type Script</h3>\\n<ol>\\n<li>\\n<p><code>tsconfig.json</code></p>\\n</li>\\n<li>\\n<p><code>global.d.ts</code></p>\\n</li>\\n</ol>\\n<ul>\\n<li>scss 인식을 못하면 <code>declare module \'*.scss\';</code> 를 추가해보자.</li>\\n</ul>\\n<h3 id=\\"주의사항\\">주의사항</h3>\\n<p>App Router 와 Page Router 에서 지원되는 기능도 다르고 공식 문서도 분리되어 있다. 예를들어 <code>getStaticProps()</code>  같은 Data Fetch 작업은 Page Router 에서는 작동하지 않는다.</p>\\n<p>style module 에서 클래스 이름에 <code>-</code> 가 들어간다면 <code>MyModule[\\"aaa-bbb\\"]</code> 이렇게 직접 써야한다. gatsby 처럼 자동으로 <code>MyModule.aaaBBB</code> 로 만들어 주지 않는다.</p>\\n<h3 id=\\"Style\\">Style</h3>\\n<p>external css 가 scss 에서 <code>@import</code> 하면 적용이 안된다. <code>&#x3C;Link></code> 를 쓰던가 css 로 하면 된다. <code>@import</code> 가 순서대로 하나씩 로딩하는거라 시간이 걸린다고 하지만 유지관리 하기가 불편해서 그냥 css 로 했다.</p>"},"_id":"blog/blogging/Setting.md","_raw":{"sourceFilePath":"blog/blogging/Setting.md","sourceFileName":"Setting.md","sourceFileDir":"blog/blogging","contentType":"markdown","flattenedPath":"blog/blogging/Setting"},"type":"BlogMDPost","url":"/posts/blog/blogging/Setting"}');

