module.exports = JSON.parse('{"title":"Particle System","date":"2023-11-08T15:00:00.000Z","body":{"raw":"\\r\\n## Particle System 의 큰 요소\\r\\n\\r\\n1. Emitter. \\r\\n    - 파티클 하나 하나를 생성하고 삭제하는 것을 관리해야함.\\r\\n\\r\\n2. Movement.\\r\\n    - 파티클 하나하나를 적절하게 이동시켜야함.\\r\\n    - 물리충돌도 가능해야함.\\r\\n\\r\\n3. Collision.\\r\\n\\r\\n3. Sorting\\r\\n    - 성능상의 이슈로 앞에서부터 그려서 culling 이 가능한게 좋음.\\r\\n\\r\\n\\r\\n4. Image\\r\\n    - 파티클마다 사람에게 이미지를 보여줘야함.\\r\\n    - 보통의 경우 삼각형을 언제나 카메라의 정면 방향으로 그림(빌보드).\\r\\n\\r\\n\\r\\n## Why do we need to sort?\\r\\n\\r\\n\\r\\n### Bitonic Sort\\r\\n\\r\\ngpu 의 이점을 살려 bitonic sort. \\r\\n\\r\\nhttps://codingdog.tistory.com/entry/%EB%B0%94%EC%9D%B4%ED%86%A0%EB%8B%89-%EC%A0%95%EB%A0%AC-%EC%97%87%EA%B0%88%EB%A0%A4-%EA%B0%80%EB%A9%B4%EC%84%9C-sorting-%ED%95%9C%EB%8B%A4\\r\\n\\r\\n## 참고자료\\r\\n\\r\\n[rastertek dx11tut39](https://rastertek.com/dx11tut39.html)\\r\\n\\r\\n[unreal4 particle doc](https://docs.unrealengine.com/4.27/ko/Resources/ContentExamples/EffectsGallery/1_B/)\\r\\n\\r\\n[Advanced Visual Effects with DirectX 11: Compute-Based GPU Particle Systems](https://www.youtube.com/watch?v=fduKhsm3ID8)","html":"<h2 id=\\"Particle-System-의-큰-요소\\">Particle System 의 큰 요소</h2>\\n<ol>\\n<li>\\n<p>Emitter.</p>\\n<ul>\\n<li>파티클 하나 하나를 생성하고 삭제하는 것을 관리해야함.</li>\\n</ul>\\n</li>\\n<li>\\n<p>Movement.</p>\\n<ul>\\n<li>파티클 하나하나를 적절하게 이동시켜야함.</li>\\n<li>물리충돌도 가능해야함.</li>\\n</ul>\\n</li>\\n<li>\\n<p>Collision.</p>\\n</li>\\n<li>\\n<p>Sorting</p>\\n<ul>\\n<li>성능상의 이슈로 앞에서부터 그려서 culling 이 가능한게 좋음.</li>\\n</ul>\\n</li>\\n<li>\\n<p>Image</p>\\n<ul>\\n<li>파티클마다 사람에게 이미지를 보여줘야함.</li>\\n<li>보통의 경우 삼각형을 언제나 카메라의 정면 방향으로 그림(빌보드).</li>\\n</ul>\\n</li>\\n</ol>\\n<h2 id=\\"Why-do-we-need-to-sort?\\">Why do we need to sort?</h2>\\n<h3 id=\\"Bitonic-Sort\\">Bitonic Sort</h3>\\n<p>gpu 의 이점을 살려 bitonic sort.</p>\\n<p><a href=\\"https://codingdog.tistory.com/entry/%EB%B0%94%EC%9D%B4%ED%86%A0%EB%8B%89-%EC%A0%95%EB%A0%AC-%EC%97%87%EA%B0%88%EB%A0%A4-%EA%B0%80%EB%A9%B4%EC%84%9C-sorting-%ED%95%9C%EB%8B%A4\\">https://codingdog.tistory.com/entry/%EB%B0%94%EC%9D%B4%ED%86%A0%EB%8B%89-%EC%A0%95%EB%A0%AC-%EC%97%87%EA%B0%88%EB%A0%A4-%EA%B0%80%EB%A9%B4%EC%84%9C-sorting-%ED%95%9C%EB%8B%A4</a></p>\\n<h2 id=\\"참고자료\\">참고자료</h2>\\n<p><a href=\\"https://rastertek.com/dx11tut39.html\\">rastertek dx11tut39</a></p>\\n<p><a href=\\"https://docs.unrealengine.com/4.27/ko/Resources/ContentExamples/EffectsGallery/1_B/\\">unreal4 particle doc</a></p>\\n<p><a href=\\"https://www.youtube.com/watch?v=fduKhsm3ID8\\">Advanced Visual Effects with DirectX 11: Compute-Based GPU Particle Systems</a></p>"},"_id":"blog/computer-science/graphics/particle-system.md","_raw":{"sourceFilePath":"blog/computer-science/graphics/particle-system.md","sourceFileName":"particle-system.md","sourceFileDir":"blog/computer-science/graphics","contentType":"markdown","flattenedPath":"blog/computer-science/graphics/particle-system"},"type":"BlogMDPost","url":"/posts/blog/computer-science/graphics/particle-system"}');

