module.exports = JSON.parse('{"title":"Attached Property VS Behavior","date":"2015-05-27T15:00:00.000Z","body":{"raw":"\\r\\n## 차이점\\r\\n\\r\\nWPF Attached Property 는 WPF Control 에 추가적인 기능을 넣기위해 사용된다. \\r\\n``` Microsoft.Xaml.Behaviors.Behavior``` 역시 마찬가지이며 내부적으론 Attached Property 로 구현되어 있다. 그래서 둘은 별개가 아니다.\\r\\n\\r\\n그럼 왜 Behavior 가 사용되는걸까? \\r\\n\\r\\n1. Attached Property 는 Static 변수나 함수를 필요로 해서 멤버변수 같은 클래스의 이점을 사용할 수 없다.\\r\\n2. Unsubscribe 를 위해서 많은 코드다발이 필요하다. 이를 까먹으면 메모리 누수가 발생한다.\\r\\n3. 편의기능을 구현할 수 있다. 예를들어 Attached Property 만으로는 드래그 앤 드랍으로 Behavior 추가같은 편의 기능을 구현할 수 없지만, Behavior 는 Collections 으로 관리되고 Subscribe / Unsubscribe 를 호출할 수 있어서 가능하다.\\r\\n\\r\\n\\r\\n\\r\\n## 참고자료\\r\\n\\r\\n[BRIAN NOYES\' BLOG](https://web.archive.org/web/20180208143035/http://briannoyesblog.azurewebsites.net/2012/12/20/attached-behaviors-vs-attached-properties-vs-blend-behaviors/)","html":"<h2 id=\\"차이점\\">차이점</h2>\\n<p>WPF Attached Property 는 WPF Control 에 추가적인 기능을 넣기위해 사용된다.\\r\\n<code> Microsoft.Xaml.Behaviors.Behavior</code> 역시 마찬가지이며 내부적으론 Attached Property 로 구현되어 있다. 그래서 둘은 별개가 아니다.</p>\\n<p>그럼 왜 Behavior 가 사용되는걸까?</p>\\n<ol>\\n<li>Attached Property 는 Static 변수나 함수를 필요로 해서 멤버변수 같은 클래스의 이점을 사용할 수 없다.</li>\\n<li>Unsubscribe 를 위해서 많은 코드다발이 필요하다. 이를 까먹으면 메모리 누수가 발생한다.</li>\\n<li>편의기능을 구현할 수 있다. 예를들어 Attached Property 만으로는 드래그 앤 드랍으로 Behavior 추가같은 편의 기능을 구현할 수 없지만, Behavior 는 Collections 으로 관리되고 Subscribe / Unsubscribe 를 호출할 수 있어서 가능하다.</li>\\n</ol>\\n<h2 id=\\"참고자료\\">참고자료</h2>\\n<p><a href=\\"https://web.archive.org/web/20180208143035/http://briannoyesblog.azurewebsites.net/2012/12/20/attached-behaviors-vs-attached-properties-vs-blend-behaviors/\\">BRIAN NOYES\' BLOG</a></p>"},"_id":"blog/study/wpf/attached-property-vs-behavior.md","_raw":{"sourceFilePath":"blog/study/wpf/attached-property-vs-behavior.md","sourceFileName":"attached-property-vs-behavior.md","sourceFileDir":"blog/study/wpf","contentType":"markdown","flattenedPath":"blog/study/wpf/attached-property-vs-behavior"},"type":"BlogMDPost","url":"/posts/blog/study/wpf/attached-property-vs-behavior"}');

