module.exports = JSON.parse('{"title":"next-js global scss order in production","date":"2015-01-01T00:00:00.000Z","tags":["nextjs","css","scss"],"body":{"raw":"\\n## 문제점\\n\\n나는 nextjs 에서 scss 를 이용해 전역변수 및 공통 스타일을 정의해두었다.\\n\\ndev 모드에서는 가장 위에 ```global.scss``` 가 컴파일되어 있어서 아무 문제가 없었다. \\n\\n그런데 build 하고 보니까 module.scss 가 맨 위로 가 있었다.\\n\\n나의 경우엔 순서가 꼬인 덕분에 ```@import```  중간에 가게 되어서 \\n폰트도 이상하게 나오고 \\n브라우저도 ```@import``` 문이 css 파일 중간에 가 있다고 이슈를 뱉었다.\\n\\n\\n## 해결\\n\\n깃허브 이슈도 뒤져봤는데 별게 없어서 그냥  ```<link/>``` 로 처리했다. \\n\\n어차피 이 방법이 파일을 병렬로 로딩해서 성능이 유의미하게 좋다. 어차피 무의미한 속도지만 말이다.\\n\\n이곳 저곳에 스타일 관련 내용이 흩어지게 되어서 이렇게 하기 싫었는데 어쩔 수가 없었다.\\n","html":"<h2 id=\\"문제점\\">문제점</h2>\\n<p>나는 nextjs 에서 scss 를 이용해 전역변수 및 공통 스타일을 정의해두었다.</p>\\n<p>dev 모드에서는 가장 위에 <code>global.scss</code> 가 컴파일되어 있어서 아무 문제가 없었다.</p>\\n<p>그런데 build 하고 보니까 module.scss 가 맨 위로 가 있었다.</p>\\n<p>나의 경우엔 순서가 꼬인 덕분에 <code>@import</code>  중간에 가게 되어서\\n폰트도 이상하게 나오고\\n브라우저도 <code>@import</code> 문이 css 파일 중간에 가 있다고 이슈를 뱉었다.</p>\\n<h2 id=\\"해결\\">해결</h2>\\n<p>깃허브 이슈도 뒤져봤는데 별게 없어서 그냥  <code>&#x3C;link/></code> 로 처리했다.</p>\\n<p>어차피 이 방법이 파일을 병렬로 로딩해서 성능이 유의미하게 좋다. 어차피 무의미한 속도지만 말이다.</p>\\n<p>이곳 저곳에 스타일 관련 내용이 흩어지게 되어서 이렇게 하기 싫었는데 어쩔 수가 없었다.</p>"},"_id":"blog/web/next-js-global-scss-order-problem.md","_raw":{"sourceFilePath":"blog/web/next-js-global-scss-order-problem.md","sourceFileName":"next-js-global-scss-order-problem.md","sourceFileDir":"blog/web","contentType":"markdown","flattenedPath":"blog/web/next-js-global-scss-order-problem"},"type":"BlogMDPost","url":"/posts/blog/web/next-js-global-scss-order-problem"}');

